from math import ceil

def calculate_optimal_room_dimensions(n, a, b):
    s = 6 / n
    if a * b >= s:
        (a_1, b_1) = (a, b)
    else:
        (a1, b1) = (min(a, b), max(a, b))
        q = [(x, ceil(s / x)) for x in range(a1, ceil(s ** 0.5)) if ceil(s / x) > b1]
        if q:
            (x, y) = min(q, key=lambda c: c[0] * c[1])
        else:
            (x, y) = (a1, ceil(s / a1))
        if x < a:
            (x, y) = (y, x)
        (a_1, b_1) = (x, y)
    return (s, a_1, b_1)

